import React from 'react';
import { styled } from '@mui/material/styles';
import {Box,Grid,Divider} from '@mui/material';

const Dashboard = () => {
  const MyGird = styled(Grid)({
    padding: `30px`
  });
  const MyDivider = styled(Divider)({
    padding: `10px`,
    width: `80%`
  });

  return (
    <Box>
      <MyGird container>
        <Grid xs={7}>
          today<br></br>
          2023.02.09
          <MyDivider/>
        </Grid>
        <Grid xs={2}>
          calandar
        </Grid>
      </MyGird>
    </Box>
  )
}

export default Dashboard
